description:
Who hasn't heard about the classic children's fairy tale of Big Bad Wolf and the Three Little Pigs? The Big Bad Wolf is always scheming and looking for prey. This time he has captured Oink-oink's friends. Join Oink-oink on the journey to save his friends in Push The Box, a new exciting puzzle game with attractive graphics that will definitely give you a challenge.
